import axios from "axios";
const baseUrl = 'https://raw.githubusercontent.com/weepiccoders/Temp-Api/main/sample.json';
function getApiReference() {

    return (
        setTimeout(() => {
            axios.get(baseUrl);
        }, 1000)
    )


}

export {
    getApiReference,
};
